import json

argmax
    "Parse the following as an object: Their name is Alice and they are 21 years old, work at LMQL Inc in Texas\n\n"
    schema = {
        "name": str,
        "age": int,
        "employer": {
            "employer_name": str,
            "location": str
        }
    }
    stack = [("", schema)]
    indent = ""
    "JSON: "
    while len(stack) > 0:
        t = stack.pop(0)
        if type(t) is tuple:
            k = t[0]
            key_type = t[1]
            last_in_object = len(stack) > 0 and stack[0] != "DEDENT"
            line_end = ",\n" if last_in_object else "\n"
            if k != "":
                "{indent}\"{k}\":"
            if key_type is str:
                '"[STRING_VALUE]{line_end}'
            elif key_type is int:
                "[INT_VALUE]"
                if INT_VALUE.endswith(",") and line_end.startswith(","):
                    "\n"
                else:
                    ",\n"
            elif type(key_type) is dict:
                "{{\n"
                indent += "\t"
                stack = [(k, key_type[k]) for k in key_type.keys()] + ["DEDENT", f"}}{line_end}"] + stack
            else:
                assert False, "not a supported type " + str(k)
        elif t == "DEDENT":
            indent = indent[:-1]
        elif type(t) is str:
            "{indent}{t}"
        else:
            assert False, "not a supported type" + str(t)
    payload = context.prompt.rsplit("JSON: ",1)[1]
    json_payload = json.loads(payload)
    print(json_payload)
from
   'chatgpt'
where
   STOPS_AT(STRING_VALUE, '"') and STOPS_AT(INT_VALUE, ",")

